import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../css/style.css';
import carouserhome from '../img/cal.jpg'; 

const SingleSlide = () => {
    return (
        <div className="container-fluid p-0 pb-5 wow fadeIn" data-wow-delay="0.1s">
            <div className="position-relative">
                <img className="img-fluid" src={carouserhome} alt="" />
                <div className="carousel-inner">
                    <div className="container">
                        <div className="row justify-content-start">
                            <div className="col-10 col-lg-8">
                                {/* <h5 className="display-3 text-white animated slideInDown">TO MEET CUSTOMERS NEEDS IS OUR RESPONSIBILITY</h5>
                                <p className="fs-5 fw-medium text-white mb-4 pb-3">The company specializes in the Powder coating & anodizing of aluminium.</p>
                                <a href="/" className="btn btn-secondary py-3 px-5 animated slideInLeft">Read More</a> */}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default SingleSlide;
